hat the pricing being loaded should be for the agreed uplifted cost; once uploaded, we can accept it and make the products visible for Miquill to place orders. For the\",1752580489265,\"thread-f:1837712372534474586|msg-f:1837713839377193512\",[[\"msg-f:1837713839377193512\",[1,\"amy.williams@a-v-e.com\",\"Amy Williams\"],[[1,\"scott.broad@a-v-e.com\",\"Scott Broad\"]],[[1,\"charlotte.follis@a-v-e.com\",\"Charlotte Follis\"],[1,\"paul.guest@a-v-e.com\",\"Paul Guest\"]],null,null,1752580489265,\"Re: Kitchen Equip\",[null,[[0,null,[null,\"\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003eHi all,\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eMy understanding is that the pricing being loaded should be for the agreed uplifted cost; once uploaded, we can accept it and make the products visible for Miquill to place orders.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eFor the historic invoices, KitchEquip might be able to provide Michelle with a list of the historic invoices so that Accounts know which ones to push through from Does Not Balance (as the price will not match what is being loaded).\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eThe issue we have with the invoices that need to be cancelled is that they do not state the products ordered. The units will likely struggle to confirm delivery of an invoice that states \\u0026quot;pound\\u0026quot; or \\u0026quot;penny\\u0026quot;; I\\u0026#39;m also not sure if Michelle needs to see the line item detail. Michelle\\u0026#39;s team has the ability to cancel orders/invoices in Procure Wizard, but may need confirmation from KitchEquip that these are being re-uploaded in order to do that? If not, KitchEquip should be able to cancel these from their end. But I am also confused by what Michelle means here so I may have misunderstood.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eMany thanks,\\u003c/div\\u003e\\u003c/div\\u003e\\u003cbr\\u003e\\u003cdiv class\\u003d\\\"gmail_quote\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\" class\\u003d\\\"gmail_attr\\\"\\u003eOn Tue, 15 Jul 2025 at 12:37, Scott Broad \\u0026lt;\\u003ca href\\u003d\\\"mailto:scott.broad@a-v-e.com\\\" target\\u003d\\\"_blank\\\"\\u003escott.broad@a-v-e.com\\u003c/a\\u003e\\u0026gt; wrote:\\u003cbr\\u003e\\u003c/div\\u003e\\u003cblockquote class\\u003d\\\"gmail_quote\\\" style\\u003d\\\"margin:0px 0px 0px 0.8ex;border-left:1px solid rgb(204,204,204);padding-left:1ex\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003eHi,\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eOn my list to clarify - im really confused if I\\u0026#39;m being honest - they have uploaded pricing that is without the retro and I had the below response from finance to the email; \\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eIn the interest of time and because I am dim, can I just clarify what I think needs to happen... \\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cul\\u003e\\u003cli\\u003eDo Kitchenequip need to upload pricing with the rebate included (i.e we need to reject what\\u0026#39;s currently on there?) \\u003c/li\\u003e\\u003cli\\u003eThen do we need to tell finance to force through the invoices and OK the does not balance? \\u003c/li\\u003e\\u003c/ul\\u003e\\u003cdiv\\u003eIF yes, I\\u0026#39;m happy to instruct just don\\u0026#39;t want to make anything worse... \\u003c/div\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cimg src\\u003d\\\"https://mail.google.com/mail/?ui\\u003d2\\u0026amp;ik\\u003d57776e095d\\u0026amp;attid\\u003d0.1\\u0026amp;permmsgid\\u003dmsg-f:1837713839377193512\\u0026amp;th\\u003d1980df0012e59a28\\u0026amp;view\\u003dfimg\\u0026amp;fur\\u003dip\\u0026amp;permmsgid\\u003dmsg-f:1837713839377193512\\u0026amp;sz\\u003ds0-l75-ft\\u0026amp;attbid\\u which has meant ratification of current invoices and some slight delay. I agree a process from Feb has taken longer than anticipated, we have also been waiting for shared services provision in order to proceed unfortunately which we will unwind shortly as we would normally expect this to have happened much sooner as suggested.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eI\\u0026#39;m only aware of this process starting in November and then running through to a decision on supplier and pricing earlier in the year, but Scott will summarise.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eRest assured we remain focused with Miquill, I know we have had some recent engagement on recruitment efficiencies with the team in our office and Ed also continues to work through the primary menus this week and is in close communication with Paul Smith.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eI\\u0026#39;m also completing all of your carbon data which will be completed by the end of this week.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003ePlease do let me know if there is anything else I can support with, i\\u0026#39;ll put a catch up in the diary.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\" class\\u003d\\\"gmail_signature\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003e\\u003cp style\\u003d\\\"margin:0px\\\"\\u003e\\u003cspan style\\u003d\\\"margin:0px\\\"\\u003e\\u003cspan style\\u003d\\\"margin:0px\\\"\\u003e\\u003cfont color\\u003d\\\"#000000\\\" face\\u003d\\\"Calibri\\\" size\\u003d\\\"3\\\"\\u003eRegards\\u003c/font\\u003e\\u003c/span\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin:0px\\\"\\u003e\\u003cspan style\\u003d\\\"margin:0px\\\"\\u003e\\u003cspan style\\u003d\\\"margin:0px;color:rgb(56,86,35);font-family:\\u00 entury Gothic\\\"\\u003e\\u003cspan lang\\u003d\\\"EN-US\\\" style\\u003d\\\"font-size:12pt;font-family:\\u0026quot;Century Gothic\\u0026quot;,sans-serif\\\"\\u003ew:\\u003cfont color\\u003d\\\"#004812\\\"\\u003e \\u003ca href\\u003d\\\"http://www.a-v-e.com\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttp://www.a-v-e.com\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1752675721905000\\u0026amp;usg\\u003dAOvVaw3PUqvko0EiluJR2Gro4H2v\\\"\\u003ehttp://www.a-v-e.com\\u003c/a\\u003e\\u003c/font\\u003e\\u003c/span\\u003e\\u003c/font\\u003e\\u003cbr\\u003e\\u003c/p\\u003e\\u003cdiv\\u003e\\u003cbr style\\u003d\\\"color:rgb(34,34,34)\\\"\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cbr\\u003e\\u003cdiv class\\u003d\\\"gmail_quote\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\" class\\u003d\\\"gmail_attr\\\"\\u003eOn Tue, 15 Jul 2025 at 12:55, Jonathan David \\u0026lt;\\u003ca href\\u003d\\\"mailto:jonathan.david@miquillcatering.co.uk\\\" target\\u003d\\\"_blank\\\"\\u003ejonathan.david@\\u003cwbr\\u003emiquillcatering.co.uk\\u003c/a\\u003e\\u0026gt; wrote:\\u003cbr\\u003e\\u003c/div\\u003e\\u003cblockquote class\\u003d\\\"gmail_quote\\\" style\\u003d\\\"margin:0px 0px 0px 0.8ex;border-left:1px solid rgb(204,204,204);padding-left:1ex\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003e\\u003cdiv\\u003eDear Jamie and Ben,\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eI would like to express my serious concerns regarding the ongoing delay in onboarding a new supplier. It has been a year since I initially raised issues with Nisbets and requested a change. Despite a tender process and a meeting with a potential new supplier in January, with an anticipated onboarding by Easter, the situation remains unresolved. This protracted delay is particularly concerning given the ongoing service and product issues experienced with Nisbets.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eAs a significant client, I find this year-long wait for a resolution unacceptable, especially given your commitment to client care as a dedicated, standalone business. The continued focus on Aspens, and their involvement in supplier meetings that exclude me, further compounds my concerns.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eWhile I understand that there may be complexities in securing new suppliers, the current level of service, or rather the lack thereof, is not what I expect. I am compelled to use your services as an external client, and I am concerned about how other external clients, who have a choice, are being treated if Miquill is experiencing such significant delays.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eSincerely,\\u003c/div\\u003e\\u003cdiv\\u003eJonathan David\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\" class\\u003d\\\"gmail_signature\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003e\\u003cfont face\\u003d\\\"verdana, sans-serif\\\" color\\u003d\\\"#444444\\\"\\u003e\\u003cb\\u003eJonathan David\\u003cbr\\u003e\\u003c/b\\u003e\\u003c/font\\u003e\\u003cdiv\\u003e\\u003cp style\\u003d\\\"margin:0cm 0cm 0pt\\\"\\u003e\\u003cfont face\\u003d\\\"verdana, sans-serif\\\" color\\u003d\\\"#444444\\\"\\u003e\\u003cb\\u003eManaging Director\\u003c/b\\u003e\\u003c/font\\u003e\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin:0cm 0cm 0pt\\\"\\u003e\\u003cb\\u003e\\u003cfont face\\u003d\\\"verdana, sans-serif\\\" color\\u003d\\\"#444444\\\"\\u003ep: 0800 043 6604      m: 07548 773901\\u003c/font\\u003e\\u003c/b\\u003e\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin:0cm 0cm 0pt\\\"\\u003e\\u003cb\\u003e\\u003cfont face\\u003d\\\
